INSERT INTO `Software_project` VALUES (30981,'turbo','gkzy','6,11','123','123','bj','',1,0,0,'','2019-04-22 09:47:05.928606',5),(30982,'猫王收音机','猫王收音机','14,23','猫王收音机','猫王收音机是一家复古收音机制造商，专注于原木手工收音机的研发与设计，旗下拥有两个品牌，分别是MAO KING和RADIOOO系列，MAO KING系列主要包括大猫王、猫王小王子、猫王小王子OTR、SOLO+等,而RADIOOO系列则包括摩德族、飞鹰、波普、电台司令等。','广东','',0,7,2,'','2019-04-22 13:17:52.446372',1),(30983,'西湖数源软件园','西湖数源软件园','6','西湖数源软件园','西湖数源软件园是一家软件园区建设运营服务提供商，为用户提供发电机供电系统、消防自动报警互联动控制系统、保安监控系统，同时根据软件企业的需要，为用户提供宽带数据接入、电视传播、电信增值服务等。','浙江','',0,23,0,'','2019-04-22 13:17:53.157835',1),(30984,'格雷博','格雷博','22','格雷博','格雷博是一家致力于“新能源开发”和“节能减排”的高新技术企业，专注于高性能电机及其控制领域，产品和服务涵盖新能源领域电机本体和电机驱动全套系统设计与生产服务，推出拥有“三高”特征（即高性能、高效率和高功率密度）的交流电机、电机控制器和电力电子设备等。','浙江','',0,26,0,'','2019-04-22 13:17:53.751607',1),(30985,'必盈咖啡','必盈咖啡','0,19','必盈咖啡','必盈咖啡，打造的线下首家智能自助服务咖啡机、项目集成了国内顶尖的智能硬件开发，和强有力的地推团队，目前无人咖啡机在北上广深等10余个城市落地，系统上线3个月以来，用户突破10万+','北京','',1,1,0,'','2019-04-22 13:17:53.891497',1),(30986,'loopers','loopers','27','loopers','上海镐泽信息科技有限公司目前的产品是一款O2O的停车服务软件，我们通过与沪上知名物业企业合作，有丰富的线下资源，我们相信，通过使用我们的软件，将会改变人们的出行方式，不再为停车而烦恼，让出行变得更愉快。','上海','',0,2,0,'','2019-04-22 13:17:54.011825',1),(30987,'Napoleon Perdis','Napoleon Perdis','29','Napoleon Perdis','Napoleon Perdis是一家澳洲本土化妆品牌，产品有眼线液、口红、遮瑕、腮红、粉底等美妆品牌。','海外','',0,23,0,'','2019-04-22 13:17:54.169273',1),(30988,'天正聚合','天正聚合','6,30','天正聚合','Techsun是一家实体零售数字化全栈解决方案提供商，为零售企业提供以实体门店为容器的全流程、全数字化解决方案，主要服务包含零售AI技术及应用产品、端到端零售业全渠道CRM咨询与部署、全渠道数据分析及会员运营服务，在过去几年里，为诸多国际国内一线零售品牌商提供了服务，包括Adidas中国、Swatch中国、微软中国零售业务群、麦当劳中国、中青旅股份、中信出版集团、P&amp;G等著名企业正在使用或部署天正公司的系统和产品。','北京','',0,2,0,'','2019-04-22 13:17:54.283222',1),(30989,'Escale','Escale','6','Escale','Escale是一家技术营销和销售公司。公司正在取代传统的外包代理和外包销售模式，这种模式的激励措施不一致，无法利用在线到线下转换渠道的数据，并创造了低于标准的客户体验。','海外','',0,10,0,'','2019-04-22 13:17:54.392670',1),(30991,'Voiceitt','Voiceitt','30','Voiceitt','Voiceitt是一家软件开发公司，开发了语音识别技术，将人们的无法理解的言语实时地转化为清晰的语音。该公司的移动应用程序使运动和言语障碍的人能够轻松地使用自己的声音与照顾者，家庭成员，医疗保健专业人士和社会进行沟通。它旨在促进包容性，使语言障碍者能够独立，提高他们的生活质量。','海外','',0,26,0,'','2019-04-22 13:17:54.702187',1),(30992,'Maurices','Maurices','0','Maurices','Maurices是一家女装连锁店。','海外','',0,24,0,'','2019-04-22 13:17:54.881979',1),(30993,'Frescobol Carioca','Frescobol Carioca','29','Frescobol Carioca','Frescobol Carioca是一家男士奢华度假服饰和生活方式品牌，提供一系列奢华的男士泳裤、度假服装和沙滩运动装备，带有鲜明的里约热内卢海滩风格。','海外','',0,4,0,'','2019-04-22 13:17:54.996041',1),(30994,'Comebey','Comebey','32','Comebey','Comebey是中东地区团购APP，与国内团购网站一样，以娱乐项目为例，一般情况下，他们对外有三种价格，团购价格、供应价格以及零售价格。团购价格最低，但有采购量的要求；供应价格是提供给旅行社的价格，比团购价略高，但没有量的要求；零售价格就是面对普通游客的价格。','海外','',0,23,0,'','2019-04-22 13:17:55.146607',1),(30995,'Lynas Corp','Lynas Corp','4','Lynas Corp','Lynas Corporation Ltd是一家澳大利亚证券交易所上市公司，从矿山到市场，创造了一个可靠的，完全整合的稀土资源。','海外','',0,23,0,'','2019-04-22 13:17:55.278259',1),(30996,'WestWellLab西井科技','WestWellLab西井科技','30','WestWellLab西井科技','WestWell Lab西井科技是一家专注研究Neuromorphic Engineering神经形态工程的类脑强人工智能商业公司，即模拟人脑神经元工作原理而制造出的芯片，它既具备人脑的学习能力，又具备强大的特定运算能力，仅需一块邮票大小的芯片，就能模仿人类大脑在短时间内处理海量的感官信息。','上海','',0,7,0,'','2019-04-22 13:17:55.407729',1),(30997,'Airwallex空中云汇','Airwallex空中云汇','16','Airwallex空中云汇','Airwallex是一个全球跨境支付平台，业务包含全球收款、货币兑换、国际付款，主要服务跨境电商、在线旅游、物流、教育与留学、金融机构、数字营销、线上娱乐等七大领域客户，致力于为各类企业提供跨境支付的一体化解决方案。','广东','',0,10,0,'','2019-04-22 13:17:55.612763',1),(30998,'Cardea Bio','Cardea Bio','23','Cardea Bio','Cardea Bio是一家生产石墨烯的生物传感器，用于监测使用半导体的生物系统。','海外','',0,4,0,'','2019-04-22 13:17:55.728388',1),(30999,'ICE','ICE','16','ICE','洲际交易所集团成立于2013年3月6日，总部位于美国乔治亚州亚特兰大。公司是一家领先的监管交易所，交易平台和清算所运营商，服务于全球农产品、信用、外汇、排放、能源及股票指数产品市场的风险管理需求。洲际交易所的客户包括来自全球70多个国家的成千上万个贸易公司，以及120个国家的市场数据客户的期货、期权、OTC掉期合约。','海外','',0,4,0,'','2019-04-22 13:17:55.833963',1),(31000,'SatoshiPay','SatoshiPay','21','SatoshiPay','SatoshiPay是英国一家“纳米支付”软件及区块链初创公司，主要基于比特币区块链技术，提供先进的双向支付平台服务，很多线上内容提供商可以通过接受超小额支付，即所谓的“纳米支付”来使自己的数字内容盈利。','海外','',0,4,0,'','2019-04-22 13:17:55.988396',1),(31001,'万乘基因','万乘基因','31','万乘基因','万乘基因是一家单细胞基因检测平台，主要业务是利用自主研发的高通量单细胞测序技术平台服务于科研、临床以及工业市场。万乘基因现有服务包括样品制备、建库测序、分析，以及样品处理等步骤，可根据客户需要自由组合，也会提供样品制备的培训、生信分析等周边服务。','北京','',0,2,0,'','2019-04-22 13:17:56.098568',1),(31002,'G