力的翅膀\n4.发挥孩子的主动性和探索求知欲望（知之者不如好之者，好之者不如乐之者），	\n兴趣是最好的老师。市场主流还是：老师教，孩子是被动地去学\n5.20年欧美儿童教育游戏经验和积累','广东','',0,2,0,'','2019-04-22 13:18:37.376790',1),(31246,'车载智能破窗装置','车载智能破窗装置','23','车载智能破窗装置','团队以军工领域技术背景以及长三角先进的的电子加工技术为牵引，完成了先进车载智能破窗装置的设计和试生产并申请专利。产品的主要功能是当车俩发生事故时自动击碎车窗玻璃，为驾驶员和乘客开辟逃生通道，具有快速、高效、安全的主要特点。\n\n      2018年4月参加苏州张家港领军人才创业大赛获得重点扶持项目\n———一个社会价值与经济价值并存的优质产品','江苏','',0,1,0,'','2019-04-22 13:18:37.530432',1),(31247,'贝瑞英语','贝瑞英语','11','贝瑞英语','把欧洲的小学课堂用AR技术还原到中国，双国双师联合授课，全球同一；\n线下运用3D投影技术，真正做到学生身临其境，让学习变成快乐的体验；\n打造免费的中外儿童社交平台，变学习为日常，迅速增加线上平台用户量。','江苏','',0,2,0,'','2019-04-22 13:18:37.719853',1),(31248,'装修生态链解决方案','装修生态链解决方案','18','装修生态链解决方案','1、为用户带来方便快捷的装修解决方案，在享受高品质产品的同时，还能节约至少15%的支出。\n2、完全释放设计师的时间和空间，模式从现有的设计师作品变成版权商品在平台进行预销售。\n3、模块化装配中心从原材料入库、分拣、创建、打包、分发、安装、废料回收形成环保装修生态链。','江苏','',0,1,0,'','2019-04-22 13:18:37.908345',1),(31249,'汽车压力传感器','汽车压力传感器','23','汽车压力传感器','上海胜脉成立于2015年5月，创始团队从事MEMS压力传感器研发及技术应用多年。多年来坚持自主研发设计，并将产品在国内领先的代工厂量产。生产出低成本、高可靠、可大批量制造的MEMS压力传感器，在汽车等领域有大量应用。 胜脉为国内超过30家汽车厂提供多种压力传感器，包括常柴、莱动、东风商用车、陕汽、五菱、济南重汽、比亚迪电动车、众泰电动车、福田电动车等。2017年出货120万只压力传感器。','上海','',0,3,0,'','2019-04-22 13:18:38.045646',1),(31250,'超融合数据防泄露产品','超融合数据防泄露产品','6','超融合数据防泄露产品','云易天成全球首家从产品设计阶段全面研发和融合DSM（国内文档加密管理技术）以及DLP（国外数据泄漏防护技术），攻克了融合的难题，并结合机器学习 & 自然语言分析和入侵防护技术，研发了目前功能最全面的数据防泄漏产品。全方位的保护企业的数据资产，真正做到对数据泄露事件的事前预防，事中保护，事后取证','北京','',0,3,0,'','2019-04-22 13:18:38.163539',1),(31251,'智慧家政','智慧家政','20','智慧家政','打造中国大规模的健康家政服务连锁机构，全国万家连锁店长引流用户进智慧家政App，用户刷脸实名登记大数据存储，根据用户需求自动匹配相对应的需求信息，一键下单，工资全程安全委托，云计算自动扣款，并且提供服务应配套的商品，支持在线商品下单交易，由连锁门店店长负责售后服务以及送货上门。\n总部盈利：\n加盟费：加盟开店收取的加盟费\n会员费：升级会员获取私聊权限\n保证金：上岗服务的诚信保证金\n管理费：工资委托扣款的平台管理费\n商品利润：用户购买商品获得利润','江苏','',0,1,0,'','2019-04-22 13:18:38.279789',1),(31252,'微酒代','微酒代','32','微酒代','酒水作为五千亿级行业，目前还不存在适合厂家和经销商的B2B服务平台。酒企竞争激烈，产品层出不穷；经销商选产品也耗费精力，且效率不高。除了糖酒会，双方再无更好的选择。微酒代的出现可以弥补酒企与经销商之间的空白，经销商足不出户通过手机APP和厂家一对一洽谈，节省时间，提高效率。\n\n微酒代为酒企，运营商与经销商提供对接平台，解决招商难，找产品难。微酒代提供商家入住平台，给酒企，运营商（开发商）全国独家代理的优质产品提供良好的展示空间，公平竞争。为经销商选择产品打开新的窗口。\n\n很多酒企与开发商的产品只做线下，原因是线上价格透明与线下冲突。但是B2B平台通过设置规则可以满足酒企的需要。虽然有阿里巴巴，易酒批，酒仙团，挖酒网等B2B电商企业，但白酒B2B仍然有巨大操作空间。','河南','',0,1,0,'','2019-04-22 13:18:38.541989',1),(31253,'莱福','莱福','20','莱福','先生女士们大家好，\n我是林其，来自广东梅州\n如对100亿计划感兴趣，请仔细阅读以下提案。\n随着时代的发展，消费能力和基数的上升，能消费500～1000元的不在少数，尤其在中国东部与全球沟通频繁更关注健康和生活品质的消费。\n根据合理推测：广州，深圳，珠海，上海，浙江，西安六大城市合计每两天就有1亿消费者\n假设在酒水消费占1╱10那么每个月至少有1千万消费数量，如果我们每个月只要占到25%的份额，每年就有3千万消费数量，平均每年每瓶赚10元，35年后那时我们除了每年支付大量税金给国家外，支付有60%的大量现金给我们供应商，合作伙伴外，我们还拥有价值100亿的公司\n这仅是六大城市给我们合起消费能力。','广东','',0,1,0,'','2019-04-22 13:18:38.662088',1),(31254,'盛太卤物','盛太卤物','20','盛太卤物','将休闲食品中增长最快的细分领域，休闲卤味制品，进行“产品+模式”双创新升级，依托门店、互联网、无人售，打通居住区、办公区、购物区三大消费场景，以更快更优更便捷的服务，打造卤味新零售的新商业模式。','浙江','',0,2,0,'','2019-04-22 13:18:38.800091',1),(31255,'菜谱端','菜谱端','20','菜谱端','未来的菜谱端用户不但可以享受到便捷的本地生活服务，也不用考虑自己或家人的每天饮食问题，平台可以通过用户的长期稳定的日常饮食（生鲜食材）用品消费的综合数据分析和科学导购，随时随地都能找到合适自己的食材和餐厅。\n       商家店铺也可直接从平台获取科学消费数据来引导调整经营策略，从而推动实现人们的饮食现代化。','广东','',0,2,0,'','2019-04-22 13:18:38.999559',1),(31256,'高回报特种养殖','高回报特种养殖','7','高回报特种养殖','本项目为竹鼠养殖。 竹鼠是一种竹子为食小动物。因其味鲜香肥美而成为人们的桌上佳肴，在都市的中高档餐饮中大受欢迎。 随着我国经济的发展，中产阶级迅速扩大，消费能力不断提升，消费水平不断提高，餐饮消费领域多样化、层次化已成为不可阻挡的趋势，鸡鸭鱼肉等常规肉类早已无法满足现代餐饮需求。就连普通菜市场，动辄几十上百元1斤的鳝鱼、娃娃鱼、海鲜等肉类早已司空见惯，批发市场更是供不应求，价格居高不下；中高端酒楼、会所比比皆是，竹鼠等高端肉类的需求持续增长。鉴于以上原因，本项目计划在本地投资兴建一座大型的竹鼠养殖基地。利用先进、科学的养殖管理技术与理念进行饲养管理，以期取得良好的经济与社会效益。在不久的将来，以第一个养殖基地为模型，在多地复制多个竹鼠养殖基地、多渠道营销，开创中国高端肉类第一品牌。','湖南','',0,3,0,'','2019-04-22 13:18:39.116651',1),(31257,'智能化垃圾收集系统','智能化垃圾收集系统','5','智能化垃圾收集系统','初创，环保类，自主研发垃圾自动收集技术，现资金瓶颈，寻求天使投资。蓝海，资深行业经验，大学科研支持，有项目落地且有项目储备，尚无现金流。','上海','',0,2,0,'','2019-04-22 13:18:39.369697',1),(31259,'大麦在线','大麦在线','32','大麦在线','随着联网的发展，B2B、B2C等模式的地位日益突出。而相对的是线下实体运营商家，运营成本居高不下。因订货量少，导致货物订购无法直接对接厂商，致使货物被多层经销商、代理商扣利，所以进货成本高。由于各厂家都有自己的地区代理商、经销商，实体运营商家订货因品种多，就需要联系多品牌代理商、经销商，订货比较繁琐。由于单一订货量少的原因，也会导致经销商、代理商不愿意配送。\n我公司专注于商超批发，深知零售行业痛点。以B2B模式实现一站式服务锁链。\n线上采购、线下配送到门店。 帮助商超解决了订货难，高额进货，货少无人配送难题，时间等......','北京','',0,1,0,'','2019-04-22 13:18:39.597744',1),(31260,'触梦-人格化智能助理','触梦-人格化智能助理','30','触梦-人格化智能助理','触梦（True Magic）文化科技成立于2018年3月，致力于精耕人格化人工智能助理领域产品与市场，应用于智能化教育培训（幼儿教育、外语培训、