人徐来，有过两次成功创业经历。我们做SaaS管理系统+珠宝+金融，在深圳罗湖区水贝片区，主要用户群体是珠宝原料供应商，工厂，成品（品牌）批发商和零售商，     我们的产品是通过SaaS系统获取/分析珠宝行业数据，打造另一个“阿里式”珠宝全功能商城和智能制造工厂，利用珠宝行业供应链金融平台促进行业闭环交易，市场规模千亿级！     我们会给珠宝行业带来生产效率的提升（人工生产比例下降）、内部管理效率的提升（更精细系统化数据化的管理）、流转效率的提升（行业SAAS）以及营销效率的提升（精准获客与库存共享）。     我们的团队来自周六福及知名品牌珠宝企业高管，研发团队来自华为，IBM等具备多年技术经验的项目管理人才；','广东','',0,2,0,'','2019-04-22 13:18:43.513886',1),(31282,'分布式数据库及区块链','分布式数据库及区块链','6','分布式数据库及区块链','数据库是所有IT系统中处于最核心的地位，而在金融、电信、电力等IT系统安全和性能等级要求最高的行业，一直受制于国际IT厂商oracle、DB2等垄断，而且其产品也越来越无法适应目前新形势下的需求。同时国家最近对于核心系统软件提倡自主可控和信息安全战略也有利于自主研发软件。我们自主研发新型OLTP关系型分布式数据库产品，已经很好的解决传统单点数据库ORACLE 、DB2等痛点，已实现在国有五大行和股份制银行多个核心交易系统替换Oracle、DB2上线使用，此外我们是唯一具有替换大型机能力的数据库产品，受到人民银行和银监会高度肯定，双十一已有贷记卡授权系统从大型机迁移至基于PC SERVER的分布式数据库上，实现了去大型机的成功案例。而且在电力、物流、电信等领域逐步推进。未来在也会在大数据和区块链进行布局和推进。','上海','',0,3,0,'','2019-04-22 13:18:44.046814',1),(31283,'百宝柜','百宝柜','20','百宝柜','具有发明专利的无人零售、自助共享任意物品给他人、收发物品的展示柜及线下展示柜硬件及线上平台，非三者简单组合而是全新解决方案。是网点、体验、费用的最佳平衡方案，是线上线下结合的基础设施。','四川','',0,1,0,'','2019-04-22 13:18:44.187738',1),(31284,'旅游休闲开发','旅游休闲开发','2','旅游休闲开发','本旅游开发项目初步计划有：1.农家乐，露天烧烤；2.游泳池，休闲垂钓池；3.山庄酒店；4.丛林探险；5.观音庙，观音像；6.真人CS区.7.农场（百香果，草莓，柚子，茶园，念子园）畜牧园；8.农田体验区；9.漂流；10.各景点亭院，铁索桥，革命烈士陵园！11.客家古围楼！本旅游开发点与红色革命旧址紧密联系在一起，如朱德领导的茂芝会议，永子良18烈士纪念馆，麒麟岭红军栈道！','广东','',0,1,0,'','2019-04-22 13:18:44.339114',1),(31285,'智慧幼儿园运营管理平台','智慧幼儿园运营管理平台','25','智慧幼儿园运营管理平台','打造通用运营平台，线上线下结合让科技的管理具体化实用化，个性特色解决不同幼儿园的需求，集合大数据运营解决落地执行，打通科技与幼儿园结合的最后一公里。\n1，提高幼儿园管理水平和效率：,建立幼儿园管理的标准SOP，让工作流程精简，从而提高幼儿园管理效率。\n2，提升幼儿园专业形象：让幼儿园管理更加科学，让招生很好的园所提升品质，同时可以有效的帮助需要招生的园所得偿所愿。帮助幼儿园免费开通宣微幼儿园平台，更好的宣传展示园所风采。\n3，建立幼师成长联盟：打破幼师成长的天花板，让幼师付出和回报成正比。\n4，清晰幼儿园运营成本：,利用解决方案，低成本、高效率、职能化的特点，快速建立起完善的运营体系，使得运营者清晰投入产出。\n5，提高家长满意度：帮助家长及时了解每日孩子在园的各项活动情况，月末汇总报表帮助家长准确掌握孩子的个性、社会性发展，良好的用户体验就是终极的竞争力。\n6，优化、减轻老师的工作：极大地减轻了教师的工作量，让老师从繁杂的观察记录和家园沟通上解放出来，投入到幼儿教育活动中。\n7，打破幼师高流动性壁垒：培养幼儿园特色课程老师，继而降低幼师流动性。稳定的教职工团队是幼儿园核心竞争力的基石','北京','',0,2,0,'','2019-04-22 13:18:44.507202',1),(31286,'千岛湖慈孝山庄养老院','千岛湖慈孝山庄养老院','31','千岛湖慈孝山庄养老院','千岛湖慈孝山庄目前已经进入综合验收阶段。现在由于股东资金紧张，寻求融资或整体股权转让。目前规划，政府补贴每年900万以上。'